import React from 'react';
import { Button, Backdrop, AppBar, Box, Container } from '@material-ui/core';
import ButtonAppBar from '../components/buttonAppBar';
import GridTest from '../components/gridTest'
import { withStyles, responsiveFontSizes } from '@material-ui/core/styles';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch
} from "react-router-dom";
const THREE = require('three');

const WrapperBox = withStyles({
  root: {
    background: '#a4d8ef',
    width: '100%',
    height: '100%',
    display: "table",
    zIndex: "unset"
  },
})(Box);

const StyledBoxBlue = withStyles({
  root: {
    background: '#a4d8ef',
    width: '100%',
    minWidth: '100%',
    height: '600px',
    display: "flex",
    textAlign: 'center',
    position: 'relative',
    justifyContent: "center",
    alignItems: "center",
    marginLeft: '0px',
    color: "white",
    fontSize: "60px",
    fontFamily: "Arial, Helvetica, sans-serif"
  },
})(Box);

const StyledBoxWhite = withStyles({
  root: {
    background: '#FFFFFF',
    width: '100%',
    minWidth:'100%',
    height: '100%',
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    marginLeft: '0px',
    color: "white",
    fontSize: "60px",
    fontFamily: "Arial, Helvetica, sans-serif"
  },
})(Box);

const HomeOptions = withStyles({
  root: {
    background: '#a4d8ef',
    width: '100%',
    height: '200px',
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    marginLeft: '0px',
    color: "white",
    fontSize: "25px",
    fontFamily: "Arial, Helvetica, sans-serif",
  },
})(Box);


const StyledButton = withStyles({
  root: {
    background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)',
    borderRadius: 3,
    border: 0,
    color: 'white',
    height: 48,
    padding: '0 30px',
    boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
  },
  label: {
    textTransform: 'capitalize',
  },
})(Button);

const cta = ["\t" + "Save", "Wearable Charity"]

const App = () => <WrapperBox>
                     <ButtonAppBar />
                     <StyledBoxBlue>
                        <img src='../static/Ellipse 47.png' style={{ position: 'relative', height: '100%', maxHeight: '100%', maxWidth: 'auto', display: 'inline-block', marginLeft: 'auto', marginRight: 'auto' }}/>
                        <div  style={{
                          whiteSpace: "pre-line", positon: 'absolute', left: '50%', top: '50%', transform: 'translate(-50%,-50%)', textAlign: 'center',  justifyContent: 'center', flexDirection: 'column', alignItems: 'center', display: 'flex'
                        }}>{cta.join('\n')}</div>
                     </StyledBoxBlue>
                     <HomeOptions>
                        <a style={{marginRight: "150px"}}>Mission Statement</a>
                        <a style={{marginLeft: "150px"}}>Click to Shop</a>
                     </HomeOptions>
                     <StyledBoxWhite>
                          <GridTest />
                      </StyledBoxWhite>
                      <StyledBoxBlue />
                   </WrapperBox>;

export default App;
